import os.path
from base64 import b64decode

#PATH LOCATION
caminho_custom = r"C:\Program Files (x86)\Steam\steamapps\common\SourceFilmmaker\game\platform\tools\stylesheets"
#DATA CONTAINING CODE FOR SMALLSHEET
DATA = b""""""
#FILE PATH, IF SMALL.QSS DOESN'T EXIST, IT WILL CREATE IT.
nome_do_arquivo = os.path.join(caminho_custom, "small.qss")

#OPENS FILE ON WRITE MODE.
arquivo = open(nome_do_arquivo, "w")
#WRITES DATA ON FILE.
arquivo.write(b64decode(DATA.replace(b"\n", b"")))
#NOT WORKING ON FILE ANYMORE, SO CLOSE IT
arquivo.close()

message = QtGui.QMessageBox()
message.setText("Style Sheet installed, check console for more information")
message.exec_()
print("You can use the menu script to quickly alter between a default one from valve(buggy)")
print("or change to the custom small.qss style!")
